import { useP5 } from 'react-p5';

const Breath = () => {
    const setup = (p5, canvasParentRef) => {
      p5.createCanvas(400, 200).parent(canvasParentRef);
    };

    const draw = (p5) => {
      p5.background(220);
      p5.ellipse(50, 50, 50, 50);
    };

    return useP5({ setup, draw });
  };

  export default Breath;
